import React, { Component } from 'react'
import axios from 'axios';
import MemberRow from './MemberRow';

class ListMembers extends Component {
    constructor(props) {
        super(props)
        this.state = {members :[]}
    };
    componentDidMount() {
        axios.get(`http://localhost:8092/familytree/member`)
          .then(response => {
            console.log(response.data);
            this.setState({members:response.data})
          }).catch(error =>{
              console.log(error);
          });
      };
      
      render() {
          return (
              <React.Fragment>
                <div align="left">
                <table className="table table-striped">
                  <thead>
                    <tr>
                      <th>ID</th>
                      <th>First Name</th>
                      <th>Last Name</th>
                      <th>Nick Name</th>
                      <th>Happy Birthday</th>
                      <th>Gender</th>
                      <th>Married</th>
                    </tr>
                  </thead>
                  <tbody>
                    {this.state.members.map(member => (
                      <MemberRow key={member.id} member={member}></MemberRow>
                    ))}
                  </tbody>
                </table> 
                </div>
              </React.Fragment>
          );
        }
}

export default ListMembers;
